import React from 'react';

export default function Attacks({ pokemon }) {

    if( {pokemon} != undefined)
    return (
        <div>
            {pokemon.attacks.map((object, i) => {
                return <div key={i} >
                    <h2>Attack: {object.name}</h2>
                    <h3>{object.text}</h3>
                    <h3>Cost: {object.cost}</h3>
                </div>
            })}
        </div>
    );
};
